INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (260, 'The 39 Steps', 'Richard Hanney has a rude awakening when a glamorous female spy falls into his bed -- with a knife in her back. Having a bit of trouble explaining it all to Scotland Yard, he heads for the hills of Scotland to try to clear his name by locating the spy ring known as "The 39 Steps."', 'Handcuffed to the girl who double-crossed him', 'https://image.tmdb.org/t/p/w500/paI9Tmqm2cZG6xy4Tnjw3Ydjuw5.jpg', NULL, '6/6/1935 12:00:00 AM', 86, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (940, 'The Lady Vanishes', 'On a train headed for England a group of travelers is delayed by an avalanche. Holed up in a hotel in a fictional European country, young Iris befriends elderly Miss Froy. When the train resumes, Iris suffers a bout of unconsciousness and wakes to find the old woman has disappeared. The other passengers ominously deny Miss Froy ever existed, so Iris begins to investigate with another traveler and, as the pair sleuth, romantic sparks fly.', 'Spies! Playing the game of love - and sudden death!', 'https://image.tmdb.org/t/p/w500/e9yjeqzcsFEhwTsv2Lv9RTZhHaJ.jpg', NULL, '10/7/1938 12:00:00 AM', 96, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (223, 'Rebecca', 'Story of a young woman who marries a fascinating widower only to find out that she must live in the shadow of his former wife, Rebecca, who died mysteriously several years earlier. The young wife must come to grips with the terrible secret of her handsome, cold husband, Max De Winter. She must also deal with the jealous, obsessed Mrs. Danvers, the housekeeper, who will not accept her as the mistress of the house.', 'The shadow of this woman darkened their love.', 'https://image.tmdb.org/t/p/w500/ovvWrzp58tc2f59n3In34wtOwV6.jpg', NULL, '3/23/1940 12:00:00 AM', 130, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (4174, 'Spellbound', 'When Dr. Anthony Edwardes arrives at a Vermont mental hospital to replace the outgoing hospital director, Dr. Constance Peterson, a psychoanalyst, discovers Edwardes is actually an impostor. The man confesses that the real Dr. Edwardes is dead and fears he may have killed him, but cannot recall anything. Dr. Peterson, however is convinced his impostor is innocent of the man''s murder, and joins him on a quest to unravel his amnesia through psychoanalysis.', 'The maddest love that ever possessed a woman.', 'https://image.tmdb.org/t/p/w500/qzqt6aZrCMicCZbCoKa6JNv0aJq.jpg', NULL, '11/8/1945 12:00:00 AM', 111, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (303, 'Notorious', 'In order to help bring Nazis to justice, U.S. government agent T.R. Devlin recruits Alicia Huberman, the American daughter of a convicted German war criminal, as a spy. As they begin to fall for one another, Alicia is instructed to win the affections of Alexander Sebastian, a Nazi hiding out in Brazil. When Sebastian becomes serious about his relationship with Alicia, the stakes get higher, and Devlin must watch her slip further undercover.', 'Notorious woman of affairs... Adventurous man of the world.', 'https://image.tmdb.org/t/p/w500/4RERYb1NIQrJHYY5e8nUlYM7t2z.jpg', NULL, '8/21/1946 12:00:00 AM', 103, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (1580, 'Rope', 'Two men attempt to prove they committed the perfect crime by hosting a dinner party after strangling their former classmate to death.', '', 'https://image.tmdb.org/t/p/w500/tJlmMbaleBT8IwuidgI0ZvlLbWA.jpg', NULL, '3/11/1948 12:00:00 AM', 81, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (845, 'Strangers on a Train', 'A deranged socialite accosts a tennis star with his theory that if two strangers trade murders, they can disguise their motives and avoid suspicion.', 'It starts with a shriek of a train whistle... and ends with shrieking excitement!', 'https://image.tmdb.org/t/p/w500/ihC083U7ef56Ui4x0P0dobojrZ1.jpg', NULL, '6/27/1951 12:00:00 AM', 101, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (521, 'Dial M for Murder', 'An ex-tennis pro carries out a plot to have his wife murdered after discovering she is having an affair, and assumes she will soon leave him for the other man anyway. When things go wrong, he improvises a new planâ€”to frame her for murder instead.', 'If a woman answers... hang on for dear life!', 'https://image.tmdb.org/t/p/w500/4qPIsFXLVH9feiRBpCf2XRZqK4k.jpg', NULL, '5/29/1954 12:00:00 AM', 105, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (567, 'Rear Window', 'A wheelchair-bound photographer spies on his neighbors from his apartment window and becomes convinced one of them has committed murder.', 'It only takes one witness to spoil the perfect crime.', 'https://image.tmdb.org/t/p/w500/qitnZcLP7C9DLRuPpmvZ7GiEjJN.jpg', NULL, '9/1/1954 12:00:00 AM', 112, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (381, 'To Catch a Thief', 'An ex-thief is accused of enacting a new crime spree, so to clear his name he sets off to catch the new thief, whoâ€™s imitating his signature style.', 'WANTED by the police in all the luxury-spots of Europe!... A catch for any woman!', 'https://image.tmdb.org/t/p/w500/wizxvCHhWTpJXxRew6FGPGFWTVl.jpg', NULL, '8/3/1955 12:00:00 AM', 107, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (574, 'The Man Who Knew Too Much', 'A widescreen, Technicolor remake by Hitchcock of his 1934 film of the same title. A couple vacationing in Morocco with their young son accidentally stumble upon an assassination plot. When the child is kidnapped to ensure their silence, they have to take matters into their own hands to save him.', 'A little knowledge can be a deadly thing!', 'https://image.tmdb.org/t/p/w500/gy8YBRjCQRIT9x9G9F5fpnFD4xw.jpg', NULL, '5/16/1956 12:00:00 AM', 120, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (426, 'Vertigo', 'A retired San Francisco detective suffering from acrophobia investigates the strange activities of an old friend''s wife, all the while becoming dangerously obsessed with her.', 'Alfred Hitchcock engulfs you in a whirlpool of terror and tension!', 'https://image.tmdb.org/t/p/w500/15uOEfqBNTVtDUT7hGBVCka0rZz.jpg', NULL, '5/28/1958 12:00:00 AM', 128, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (213, 'North by Northwest', 'Advertising man Roger Thornhill is mistaken for a spy, triggering a deadly cross-country chase.', 'It''s a deadly game of ''tag'' and Cary Grant is ''it''...', 'https://image.tmdb.org/t/p/w500/9pf8CuIT64cFvsyocWOjbKGcXmt.jpg', NULL, '7/8/1959 12:00:00 AM', 136, '2636', NULL);
INSERT INTO movie (movie_id, title, overview, tagline, poster_path, home_page, release_date, length_minutes, director_id, collection_id) VALUES (539, 'Psycho', 'When larcenous real estate clerk Marion Crane goes on the lam with a wad of cash and hopes of starting a new life, she ends up at the notorious Bates Motel, where manager Norman Bates cares for his housebound mother.', 'A newâ€”and altogether differentâ€”screen excitement!', 'https://image.tmdb.org/t/p/w500/nR4LD4ZJg2n6LZQpcOrLFdMq0cD.jpg', NULL, '6/22/1960 12:00:00 AM', 109, '2636', '119674');
